import React from "react";

const Specs = ({ title, cover, items }) => {
  return (
    <section className="min-h-screen flex md:flex-row flex-col padding">
      <div className="md:w-1/2">
        <img src={cover} alt={title} />
      </div>
      <div className="md:w-1/2">
        <div className="grid-cols-2">{items.map((item, index) => {})}</div>
      </div>
    </section>
  );
};

export default Specs;
